import React, { Component } from 'react'
import Quiz from './Quiz/Quiz.js'
export default class App extends Component {
  render() {
    return (
      <React.StrictMode>
        <>
          <meta name="viewport" content="width=device-width, initial-scale=1"></meta>
          <Quiz></Quiz>
        </>
      </React.StrictMode>
    )
  }
}
